import axios from 'axios'


const URL_GROUP='http://localhost:8080/api/groups'

class Groups {
  

   getGroups(){
       return fetch(URL_GROUP,{
           method:'get',
           headers:{
               'Accept':'application/json',
               'Content-Type':'application/json'
           }
       }).then((res=>res.json()));
   }
    
}
export default new Groups();



/**
 * 
 * 
 *  {/** getGroups(){
        return axios.get(URL_GROUP);
    } */
